configure:
  commands:
    end:
      new_state: execute
    ipv6 access-list IPV6_CRITICAL_AUTH_ACL: "ipv6 access-list IPV6_CRITICAL_AUTH_ACL\r\
      \n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    sequence 10 permit ipv6 any any: "sequence 10 permit ipv6 any any\r\n"
  prompt: stack-12m(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack-12m(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack-12m#
